import styled from 'styled-components';

export const Container = styled.div`

  form{
    place-content: center;
  }
  button{
    font: normal normal 24px/33px;
    font-weight: bold;
    letter-spacing: 0px;
    color: #FFFFFF;
    opacity: 1;

    width: 13.06rem;
    height: 1.6rem;
    background: #FBBC56 0% 0% no-repeat padding-box;
    box-shadow: 0px 10px 10px #00000029;
    border-radius: 12px;
    border: 0;
    padding: 15px 19px;
    opacity: 1;

  }
`
